import React from 'react'
import {Menu} from 'antd';
import {CopyOutlined, UserOutlined, ExportOutlined, EditOutlined} from '@ant-design/icons';
import {Link, useLocation} from "react-router-dom";
import { isAuthenticated } from '../../utils/auth/isAuthenticated';


const TodoMenu = () => {
    return (
        <div className="menu">
        {console.log(isAuthenticated)}
            <Menu selectedKeys={
                    useLocation().pathname
                }
                mode="horizontal">
                {
                    isAuthenticated ?  <Menu.Item key="todos"
                    icon={<CopyOutlined/>}>
                    <Link to="/todos">Todos</Link>
                     </Menu.Item>: null
                }


                {
                    !isAuthenticated ? <Menu.Item key="login"
                    icon={<UserOutlined/>}>
                    <Link to="/login">Login</Link>
                </Menu.Item>: null
                }

               {
                   !isAuthenticated ?  <Menu.Item key="register"
                    icon={<EditOutlined/>}>
                    <Link to="/register">Register</Link>
                </Menu.Item>: null
               }

               {
                   isAuthenticated ?  <Menu.Item icon={<ExportOutlined/>}
                    key="logout">
                    <Link to="/logout">Logout</Link>
                </Menu.Item> :null
               }

            </Menu>
        </div>
    )
}

export default TodoMenu
